create table oss_object
(
    file_id       int auto_increment
        primary key,
    create_date   varchar(16)  null,
    create_time   varchar(16)  null,
    file_path     varchar(255) null,
    file_all_path varchar(255) null,
    file_name     varchar(255) null,
    file_md5      varchar(255) null,
    file_size     double       null
)
    comment '对象存储信息表' collate = utf8_bin;

